    public static function getApplicants($company, $county = null, $requires_dbs_check = null, $position_applied_for = null)
    {
        //grab the entire list of applicants and then loop through the array and use below logic to create an array of the relevant applicants from the search
        $list_of_applicants = Applicant::listOfApplicants();
        $selected_applicants  = array();
        if(!empty($company))
        {
            foreach($list_of_applicants as $possible_applicant){
                if(
                    ($possible_applicant['recruitment_company_id'] == $company->company_id) &&
                    (empty($county) || $county == $possible_applicant['county']) &&
                    ($requires_dbs_check == $possible_applicant['requires_dbs_check']) &&
                    (empty($position_applied_for) || $position_applied_for == $possible_applicant['applied_for'])
                )
                {
                    $selected_applicants[] = $possible_applicant;
                }
            }
            return $selected_applicants;
        }else{
            return false;
        }
    }

